import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardHeader from "@mui/material/CardHeader";
import CssBaseline from "@mui/material/CssBaseline";
import Grid from "@mui/material/Grid";
import StarIcon from "@mui/icons-material/StarBorder";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Link from "@mui/material/Link";
import GlobalStyles from "@mui/material/GlobalStyles";
import Container from "@mui/material/Container";
import { useNavigate } from "react-router-dom";
import Electronics from "./Electronics";

const tiers = [
  {
    title: "Electronics",
    imgUrl:
      "data:image/jpeg;base64,",
    buttonText: "Explore Electronics",
    buttonVariant: "outlined",
  },
  {
    title: "Fashion",
    imgUrl:
      "data:image/jpeg;base64,",
    buttonText: "Explore Fashion",
    buttonVariant: "outlined",
  },
  {
    title: "Books",
    imgUrl:
      "data:image/jpeg;base64,",
    buttonText: "Explore Books",
    buttonVariant: "outlined",
  },
];

function PricingContent() {
  let navigate = useNavigate();
  const titelCategoryHandler = (category) => {
    if (category === "Electronics") {
      navigate("/products/electronics");
    } else if (category === "Fashion") {
      navigate("/products/fashion");
    } else {
      navigate("/products/books");
    }
  };

  return (
    <React.Fragment>
      <GlobalStyles
        styles={{ ul: { margin: 0, padding: 0, listStyle: "none" } }}
      />
      <CssBaseline />

      {/* Hero unit */}
      <Container
        disableGutters
        maxWidth='sm'
        component='main'
        sx={{ pt: 8, pb: 6 }}>
        <Typography
          component='h1'
          variant='h2'
          align='center'
          color='text.primary'
          gutterBottom>
          Pricing
        </Typography>
        <Typography
          variant='h5'
          align='center'
          color='text.secondary'
          component='p'>
          Quickly build an effective pricing table for your potential customers
          with this layout. It&apos;s built with default MUI components with
          little customization.
        </Typography>
      </Container>
      {/* End hero unit */}
      <Container maxWidth='md' component='main'>
        <Grid container spacing={5} alignItems='flex-end'>
          {tiers.map((tier) => (
            // Enterprise card is full width at sm breakpoint
            <Grid
              item
              key={tier.title}
              xs={12}
              sm={tier.title === "Electronics" ? 12 : 6}
              md={4}>
              <Card>
                <CardHeader
                  title={tier.title}
                  titleTypographyProps={{ align: "center" }}
                  action={tier.title === "Pro" ? <StarIcon /> : null}
                  subheaderTypographyProps={{
                    align: "center",
                  }}
                  sx={{
                    backgroundColor: (theme) =>
                      theme.palette.mode === "light"
                        ? theme.palette.grey[200]
                        : theme.palette.grey[700],
                  }}
                />
                <CardContent>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "center",
                      alignItems: "baseline",
                      mb: 2,
                    }}>
                    <img src={tier.imgUrl} alt='img' />
                  </Box>
                </CardContent>
                <CardActions>
                  {/* <Button fullWidth variant={tier.buttonVariant}>
                    {tier.buttonText}
                  </Button> */}
                  <Button
                    onClick={() => titelCategoryHandler(tier.title)}
                    fullWidth
                    variant={tier.buttonVariant}>
                    {tier.buttonText}
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </React.Fragment>
  );
}

export default function Pricing() {
  return <PricingContent />;
}
